function adjustReportRowOutput(row, selectedDimensions) {
    if (!row) return row;
    if (typeof row !== 'object') return row;
	if (!Array.isArray(row.keys)) return row;
    if (!Array.isArray(selectedDimensions)) return row;

    const dimensionsObj = row.keys.reduce(
        (acc, k, idx) => ({
            ...acc,
            [selectedDimensions[idx]]: k,
        }),
        {}
    );

    return {
        ...dimensionsObj,
        ...row,
        keys: undefined,
    };
}

