function formatFilterForAnalytics(filterGroups) {
    if (!filterGroups) return undefined;
    if (!Array.isArray(filterGroups))
        throw new TypeError('"filterGroups" must be an instance of Array.');

    return filterGroups.map((item, idx) => {
        if (!item.filters)
            throw new Error(
                `"filters" in "filterGroups" at index ${idx} must exist.`
            );
        if (!Array.isArray(item.filters))
            throw new TypeError(
                `"filters" in "filterGroups" at index ${idx} must be an instance of Array.`
            );
        if (!item.groupType)
            throw new Error(
                `"groupType" in "filterGroups" at index ${idx} must exist.`
            );

        // applying flat() before due to that it doesn't matter which logic is being used in the filter group
        // "OR" logic will result an array of arrays containing 1 object
        // "AND" logic will result an array of 1 array containing multiple objects
        // flatMap() doesn't work well here 'cuz it flattens the array after the "map" function
        // while we need the array to be flattened before
        const filters = item.filters.flat().map((filter) => ({
            dimension: filter.a,
            operator: filter.o,
            expression: filter.b,
        }));

        return {
            ...item,
            filters,
        };
    });
}

