function convertScreenshotDataToBuffer(mobileFriendlyTestResponse) {
	if (typeof mobileFriendlyTestResponse !== 'object') 
		throw new TypeError('Input is expected to be an object.')

	const screenshot = mobileFriendlyTestResponse.screenshot;

    if (!screenshot) return mobileFriendlyTestResponse;
    if (!screenshot.data) return mobileFriendlyTestResponse;

    return {
        ...mobileFriendlyTestResponse,
        screenshot: {
            ...screenshot,
            data: iml.toBinary(screenshot.data, 'base64'),
        },
    };
}

